class Solution:    def partitionDisjoint(self, A):        """        :type A: List[int]        :rtype: int        """        n=len(A)        leftmax=[-float("inf") for i in range(n)]        rightmin=[float("inf") for i in range(n)]        index_left,index_right=-float("inf"),float("inf")        for i in range(n):            if index_left<A[i]:                index_left=A[i]            leftmax[i]=index_left        for i in range(n-1,-1,-1):            if index_right>A[i]:                index_right=A[i]            rightmin[i]=index_right        for i in range(1,n,1):            if leftmax[i-1]<=rightmin[i]:                return is=Solution()A=[5,0,3,8,6]print(s.partitionDisjoint(A))